const League = (props) => {
    function getLeagueName(){
        let pathname = window.location.pathname;

    }
    const leagueName = useState(getLeagueName());
    return(
        <div id = "League">
            <div>
                <SideBar></SideBar>
            </div>
            <div>
                <SocialHeader>{{"type":"noButton"}}</SocialHeader>
                <LeagueHeader>{{"name": leagueName}}</LeagueHeader>
                <LeagueChallengeList></LeagueChallengeList>
                <LeagueLeaderboard></LeagueLeaderboard>
            </div>
            <div>
                <SocialHeader>{{"type":"noButton"}}</SocialHeader>
                <LeagueHeader>{{"name": leagueName}}</LeagueHeader>
                <LeagueMemberList></LeagueMemberList>
            </div>
            <div>

            </div>
        </div>
    )
}

export default League;
